import {Link} from "react-router-dom";
import { NavBar, Heading, NotifDiv, Back } from "./task-nav.styles"

export const TaskNav = ({title}) => {
    return (
        <NavBar>
            <Link to = "/all-projects" style={{textDecoration:'none'}}> 
                <Back> <p> {`< Back`} </p></Back> 
            </Link>
            <Heading> {title} </Heading>
            <NotifDiv> N </NotifDiv>
        </NavBar>
    )
}
